import Vue from 'vue'
import VueRouter from 'vue-router'


Vue.use(VueRouter)

const routes = [
  {
    path: '/login',
    name: 'Login',
    component: () => import( '../views/LoginView.vue')
  },
  {
    path: '/home',
    name: 'Home',
    component: () => import( '../views/HomeView.vue')
  },
  {
    path: '/',
    redirect: '/login',
  }
]

const router = new VueRouter({
  routes
})

export default router
